import React from 'react';

const GridCard = ({card, i, _i, planeswalk, planeswalking}) => {
    const src = card ? card.img : 'back.png';

    return ( 
        <div onClick={() => planeswalk(i, _i)} className={`grid-card ${card ? '' : 'no-border'} ${planeswalking ? 'selectable' : ''}`}>
            <div className='img-container'>
                <img src={require(`../assets/images/${src}`)} alt=""/>
            </div>
            {card ? <div className='name'><p>{card.name}</p></div> : null}
        </div>
     );
}

export default GridCard;
